 I'm asking because I'm not sure when to use one over the other. I've read the documentation but I'm still not sure.

## Answer

cloneElement is used to pass props to a component that you don't own. For example, if you're writing a TabBar component that displays a bunch of tabs, you might write something like this:
```
render() {
  return (
    <div>
      {this.props.tabs.map(tab => <Tab {...tab} />)}
    </div>
  );
}
```
This is fine, but what if you want to pass a prop to the Tab component from the TabBar ? You can't do this with the above setup, because you don't own the Tab component - you're just passing it along. So you need to clone the element and pass the prop to the clone:
```
render() {
  return (
    <div>
      {this.props.tabs.map(tab => React.cloneElement(tab, { foo: 'bar' }))}
    </div>
  );
}
```
Now, each Tab will receive a foo prop with value bar .

