        System.out.println("You go straight and find a village.");
        System.out.println("Invalid choice.");
In this example, the switch statement checks the value of choice and executes the corresponding code block. If the value of choice is not 1, 2, or 3, the default code block is executed. This allows you to have multiple choices and different outcomes for each choice in a more organized way.

